import React from "react";
import "./Navbar.css";
import Button from '@mui/material/Button';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
export default function Navbar() {
  return (
    <>
      <nav>
        <h1>BrainyLingo</h1>

        <ul>
          <li>
            <a href="">Home</a>{" "}
          </li>
          <li>
            {" "}
            <a href="">Leaderboard</a>
          </li>
          <li>
            {" "}
            <a href="">Daily Quiz</a>
          </li>
          <li>
            <a href="">Genre</a>
          </li>
        </ul>

        <button id="SignOut">Sign Out</button>
      </nav>

      <h1 id="HeadingLine">Science Fiction Stories</h1>

      <div id="ProgressButtons">
        <button><img src=<AccountCircleIcon /> alt="" />New</button>
        <button><img src="" alt="" />In Progress</button>
        <button><img src="" alt="" />Completed</button>
        <button><img src="" alt="" />Clear All</button>
      </div>
    </>
  );
}
